// import { INITAL_STATE } from '../actions/counter/counterActions';
// const INITAL_STATE = {
//     count: 0,
//     name: 'Eric'
// };
const userReducer = (state = INITAL_STATE, action) => {
    switch (action.type) {
        case SDFSDF:
            return {
                ...state.coasdqwe
            };
        case gyhjk:
            return {
                ...state, count: state.count
            }
    }
};
export default userReducer;
